import React from "react";

const Component = info => {
  return (
    <div
      style={{
        backgroundColor: info.colors[0],
        color: info.colors[2],
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        minHeight: "80vh",
        width: "80vw"
      }}
    >
      <h2>Privacy Policy:</h2>
      <p style={{ textJustify: "center" }}></p>
    </div>
  );
};

export default Component;
